  return (
    <div className="ViewPost">
        view post
    </div>
  );
}

let mapStateToProps=(state)=>{
    return{
        posts:state.posts,
    }
  };
  
  ViewPost.propTypes = {
    post: PropTypes.object
  }
  const viewPost = connect(mapStateToProps,null) (ViewPost);
  export default viewPost;
